import React from 'react';
import NavigationItem from './navigation-item/NavigationItem';
import { Link } from 'react-router-dom';

export const NavigationItems = ({ link, isUserLoggedIn, children }) => {
  return (
    <ul>

      <NavigationItem
        
        
      >
        {children}
      </NavigationItem>
      {isUserLoggedIn ?
        <NavigationItem
          Link to={ link }
        >
          {children}
      </NavigationItem>
        : null}
      {isUserLoggedIn ?
        <NavigationItem
          link={link}
        >
          
      </NavigationItem>
        : <NavigationItem
          link={link}
        >
          Logout
      </NavigationItem>}

    </ul>
  );
}
